(function() {
  var Seq, exec, fs;
  fs = require('fs');
  exec = require('child_process').exec;
  Seq = require('seq');
  Seq().seq_(function(next) {
    return exec('whoami', next);
  }).par_(function(next, who) {
    return exec('groups ' + who, next);
  }).par_(function(next, who) {
    return fs.readFile(__filename, 'utf8', next);
  }).seq_(function(next, groups, src) {
    console.log('Groups: ' + groups.trim());
    return console.log('This file has ' + src.length + ' bytes');
  });
}).call(this);
